          options={{ headerShown: false }}
        />
        <Stack.Screen
          name="Curriculos"
          component={curriculos}
        />
      </Stack.Navigator>
    </NavigationContainer>
  );
};

function App() {


  return (
    <div className="App">
      <Routers />
    </div>
  );
}

export default App;
